webpackJsonp([136],{698:function(n,t){n.exports="import React, { Component } from 'react'\nimport { NavBar } from 'key-ui/nav-bar'\nimport { Progress } from 'key-ui/progress'\n\nexport default class Demo extends Component {\n  state = {\n      p1: 0,\n      p2: 0,\n      p3: 10,\n  }\n\n  componentDidMount() {\n      setTimeout(() => this.setState({ p2: 50, p3: 60 }), 1000)\n      this.clock = setInterval(\n          () => this.setState({ p1: this.state.p1 + (Math.random() * 100) }),\n          500,\n      )\n  }\n\n  componentDidUpdate() {\n      if (this.state.p1 > 70) {\n          clearInterval(this.clock)\n      }\n  }\n\n  render() {\n      return (\n          <div>\n              <NavBar title=\"Progress Demo\" />\n              <Progress noTrace percent={this.state.p1} />\n              <br />\n              <br />\n              <br />\n              <p>有轨迹阴影</p>\n              <Progress percent={this.state.p2} />\n              <p>没有</p>\n              <Progress noTrace percent={this.state.p3} />\n          </div>\n      )\n  }\n}\n"}});